void clearCSV()
{
    std::ofstream csvFile;

    csvFile.open("output.csv");
    csvFile << "test_name,time_in_ms,elements_in_tree,tree_height,m,M,class\n";
}

/**
 * DESCRIPTION: Função para salvar as informações em um arquivo de log
 */
void logInCSV(std::string testname, std::chrono::time_point<std::chrono::high_resolution_clock> start,
              std::chrono::time_point<std::chrono::high_resolution_clock> end, const RTree& tree,
              std::size_t m, std::size_t M, std::size_t cls)
{
    // Calculando o tempo em MS
    auto initialTime = std::chrono::time_point_cast<std::chrono::microseconds>(start).time_since_epoch().count();
    auto finalTime = std::chrono::time_point_cast<std::chrono::microseconds>(end).time_since_epoch().count();

    std::ofstream csvFile;
    csvFile.open("output.csv", std::ios_base::app);

    // Salvando as informações
    csvFile << testname;
    csvFile << ",";
    csvFile << ((finalTime - initialTime) * 0.001); // Usei dessa forma para aparecer os decimais,
                                                    // converter direto para milli com o chrono ficava estranho, sem os decimais 
    csvFile << ",";
    csvFile << tree.count();
    csvFile << ",";
    csvFile << tree.height();
    csvFile << ",";
    csvFile << m;
    csvFile << ",";
    csvFile << M;
    csvFile << ",";
    csvFile << cls;
    csvFile << "\n";
}

/**
 * DESCRIPTION: Função auxiliar para facilitar a visualização da quantidade de elementos na árvore
 */
void printElementsInTree(const RTree& tree) 
{
    std::cout << "Quantidade de elementos na árvore: " << tree.count() << std::endl;
}

/**
 * DESCRIPTION: Função auxiliar para facilitar a visualização da altura da árvore
 */
void printTreeHeight(const RTree& tree)
{
    std::cout << "Altura da árvore: " << tree.height() << std::endl;
}

/**
 * DESCRIPTION: Função auxiliar para facilitar a visualização dos resultados
 * 
 * SEE: http://www.cplusplus.com/reference/chrono/high_resolution_clock/now
 * SEE: https://en.cppreference.com/w/cpp/chrono/time_point/time_since_epoch
 */
void printTimeLog(std::chrono::time_point<std::chrono::high_resolution_clock> start, 
                    std::chrono::time_point<std::chrono::high_resolution_clock> end)
{
    auto initialTime = std::chrono::time_point_cast<std::chrono::microseconds>(start).time_since_epoch().count();
    auto finalTime = std::chrono::time_point_cast<std::chrono::microseconds>(end).time_since_epoch().count();

    std::cout << "Tempo utilizado: " << (finalTime - initialTime) * 0.001 << " (ms)" << std::endl;
}

void printRecoveredElements(std::vector<RNode*> els, int nCorrected)
{
    std::cout << "Foram encontrados " << els.size() << "/" << nCorrected << std::endl;
}

